        Everyone owns a smartphone, my designs keep this in mind to provide clean experiences for both mobile and desktop users. 


    Secure

    Hosting and Management

    */

    return(
        <div className='IconInfoBar'>
            <BarIcon iconName='user' iconActive={true} />
            <BarIcon iconName='computer' iconActive={true} />
            <BarIcon iconName='database' iconActive={true} />
            <BarIcon iconName='smartphone' iconActive={true} />
            <BarIcon iconName='lock' iconActive={true} />
            <BarIcon iconName='upload' iconActive={true} />
        </div>
    );
}

export default IconInfoBar;
